import React, { useState } from 'react'
import CreateExam from './CreateExam';
import CreateQuestionForm from './CreateQuestion';

function Exam() {
    const [currentComponent, setCurrentComponent] = useState(<CreateExam/>);

  const handleNavigate = (component) => {
    setCurrentComponent(component);
  };
  return (
    <>
        <div>
      {currentComponent === <CreateExam/> && (
        <CreateExam onNavigate={()=> handleNavigate(<CreateQuestionForm/>)}/>
      )}
      {currentComponent === <CreateQuestionForm/> && (
        <CreateQuestionForm />
      )}
    </div>
    </>
  )
}

export default Exam
